import * as React from 'react';
import { ReactElement } from 'react';

export interface IUsersProps {
    dados: Array<ReactElement>
}

export default class Users extends React.Component<IUsersProps> {

  public render() {

    const dados = this.props.dados

    return (
      <div>
          {dados}
      </div>
    );
  }
}
